member.summary:
Output only. The name of the cluster resource with the format:
 * projects/{project}/locations/{region}/clusters/{cluster_id}
where the cluster ID segment should satisfy the regex expression
`[a-z0-9-]+`. For more details see https://google.aip.dev/122.
The prefix of the cluster resource name is the name of the parent resource:
 * projects/{project}/locations/{region}

Optional password for logging in to a docker registry. If password
matches `projects/*/secrets/*/versions/*` then Batch will read the
password from the Secret Manager;

The URL of an existing network resource.
You can specify the network as a full or partial URL.

For example, the following are all valid URLs:

* https://www.googleapis.com/compute/v1/projects/{project}/global/networks/{network}
* projects/{project}/global/networks/{network}
* global/networks/{network}

The URL of an existing subnetwork resource in the network.
You can specify the subnetwork as a full or partial URL.

For example, the following are all valid URLs:

* https://www.googleapis.com/compute/v1/projects/{project}/regions/{region}/subnetworks/{subnetwork}
* projects/{project}/regions/{region}/subnetworks/{subnetwork}
* regions/{region}/subnetworks/{subnetwork}

The prefix of the resources the system should use for temporary storage. The system will append the suffix "/temp-{JOBNAME} to this resource prefix, where {JOBNAME} is the value of the job_name field. The resulting bucket and object prefix is used as the prefix of the resources used to store temporary data needed during the job execution. NOTE: This will override the value in taskrunner_settings. The supported resource type is:
Google Cloud Storage:
storage.googleapis.com/{bucket}/{object} bucket.storage.googleapis.com/{object}

The dataset for the current project where various workflow related tables are stored.
The supported resource type is:
Google BigQuery: bigquery.googleapis.com/{dataset}

Required. The resource name of the dns peering zone.
Format:
projects/{project}/locations/{location}/instances/{instance}/dnsPeerings/{dns_peering}

Output only. The relative resource name of the Data Attribute Binding, of
the form:
projects/{project_number}/locations/{location}/dataAttributeBindings/{data_attribute_binding_id}

Optional. List of attributes to be associated with the resource, provided
in the form:
projects/{project}/locations/{location}/dataTaxonomies/{dataTaxonomy}/attributes/{data_attribute_id}

Optional. List of attributes to be associated with the path of the
resource, provided in the form:
projects/{project}/locations/{location}/dataTaxonomies/{dataTaxonomy}/attributes/{data_attribute_id}

A timestamp value.
When stored in the Datastore, precise only to microseconds;
any additional precision is rounded down.

Immutable. Self-link of the GCP resource for the GKE cluster. For example:

//container.googleapis.com/projects/my-project/locations/us-west1-a/clusters/my-cluster

Zonal clusters are also supported.

Immutable. Self-link of the GCP resource for the GKE On-Prem cluster. For
example:

 //gkeonprem.googleapis.com/projects/my-project/locations/us-west1-a/vmwareClusters/my-cluster
 //gkeonprem.googleapis.com/projects/my-project/locations/us-west1-a/bareMetalClusters/my-cluster

Immutable. Self-link of the GCP resource for the GKE Multi-Cloud cluster.
For example:

 //gkemulticloud.googleapis.com/projects/my-project/locations/us-west1-a/awsClusters/my-cluster
 //gkemulticloud.googleapis.com/projects/my-project/locations/us-west1-a/azureClusters/my-cluster
 //gkemulticloud.googleapis.com/projects/my-project/locations/us-west1-a/attachedClusters/my-cluster

Immutable. Self-link of the GCP resource for the Edge Cluster. For
example:

//edgecontainer.googleapis.com/projects/my-project/locations/us-west1-a/clusters/my-cluster

Immutable. Self-link of the GCP resource for the Appliance Cluster. For
example:

//transferappliance.googleapis.com/projects/my-project/locations/us-west1-a/appliances/my-appliance

Resource name of the Media Warehouse corpus.
Format:
projects/${project_id}/locations/${location_id}/corpora/${corpus_id}

If true, the prediction request received by custom model will also contain
metadata with the following schema:
'appPlatformMetadata': {
      'ingestionTime': DOUBLE; (UNIX timestamp)
      'application': STRING;
      'instanceId': STRING;
      'node': STRING;
      'processor': STRING;
 }

The name of the media warehouse asset for long term storage of stream data.
Format: projects/${p_id}/locations/${l_id}/corpora/${c_id}/assets/${a_id}
Remain empty if the media warehouse storage is not needed for the stream.

The service account associated with the latest workflow version. This service account represents the identity of the workflow and determines what permissions the workflow has. Format: projects/{project}/serviceAccounts/{account} or {account}
Using `-` as a wildcard for the `{project}` or not providing one at all will infer the project from the account. The `{account}` value can be the `email` address or the `unique_id` of the service account.
If not provided, workflow will use the project's default service account. Modifying this field for an existing workflow results in a new workflow revision.
